import React from "react";
import footer from "../assets/footer.png";

const Footer = () => {
  return (
    <footer>
      <div className="row">
        <div className="col">
          <img src={footer} className="logo" alt="footer" />
          <p>copy right</p>
          <p>copy right 1</p>
        </div>
        <div className="col"></div>
        <div className="col"></div>
        <div className="col"></div>
      </div>
    </footer>
  );
};

export default Footer;
